create table imagem (
    id INT PRIMARY KEY,
    nome VARCHAR(255),
    base64 CLOB,
    tipo_imagem VARCHAR(255),
    data_cadastro TIMESTAMP,
    usuario_cadastro VARCHAR(255)
);
